import React from "react";

function Rectangle() {
  return (
    <div className="wrapper">
      <div className="containerRectangle">
        <div className="rectangle"></div>
        <div className="rectangle"></div>
        <div className="rectangle"></div>
      </div>
    </div>
  );
}

export default Rectangle;
